import "./MainContentStyles/MainContent.scss";
import star from "./MainContentStyles/star.png";
function MainContent(props) {
  console.log(props.index)
  return (
    <table>
    <tr className="mainContent">
      <td className="cont1">
        <p>1</p>
        <img src={star} alt="" width="10%" height="100%" />
      </td>

      <td className="cont2">
      <img
          src={props.img}
          alt=""
        />
        <p>{props.name}</p>
      </td>
      <td className="cont3">{props.symbol}</td>
      <td className="cont4">
        {props.current_price}
        </td>
      <td className="cont5">{props.price_24h}</td>
      <td className="cont6">{props.price_24h}</td>
      <td className="cont7">{props.price_7days}</td>
      <td className="cont8">{props.total_volume}</td>
      <td className="cont9">{props.mkt_cap}</td>
      <td className="cont10">{props.mkt_cap_24h}</td>
    </tr>
    </table>
  );
}

export default MainContent;
